Route::get('/proxy/atms', function () {
    $baiApiUrl = 'https://ib.bancobai.ao/portal/api/internet/agencies?noCacheHelper=1758630425539&appVersion=v1.12.09';

    try {
        // O seu servidor Laravel faz a chamada para a API do BAI
        $response = Http::get($baiApiUrl);

        // Se a chamada falhar, retorna um erro
        if ($response->failed()) {
            return response()->json(['error' => 'Falha ao comunicar com a API do BAI.'], 502); // 502 Bad Gateway
        }

        // Se a chamada for bem-sucedida, retorna os dados da API do BAI diretamente para o seu front-end
        return $response->json();

    } catch (\Exception $e) {
        // Captura outros erros de conexão
        return response()->json(['error' => 'Erro interno no servidor ao tentar fazer o proxy.', 'message' => $e->getMessage()], 500);
    }
});

